(1, 'В июле с помощью смартфонов зафиксировали рекордное количество ДТП', 'За июль 2023 года в России при помощи смартфонов зафиксировали рекордные 11 тыс. ДТП на дорогах\r\n\r\nВ июле 2023 года количество аварий, зафиксированных при помощи смартфонов, стало рекордным, говорится в совместном пресс-релизе Российского союза автостраховщиков (РСА) и Всероссийского союза страховщиков (ВСС).\r\n\r\nВсего за обозначенный период было зафиксировано 11 тыс. ДТП, что на 13% больше среднемесячного показателя первого полугодия 2023 года (9,7 тыс. фото) и в 2,2 раза превысило среднемесячное количество снимков в первом полугодии 2022 года (4,9 тыс. фото).\r\n\r\nВ июле 2023 года наибольшее количество фото было произведено при помощи приложения «ДТП.Европротокол» (7,2 тыс. шт.), что на 34% больше, чем в июле 2022 года (5,4 тыс.). При помощи приложения «Госуслуги Авто» в июле 2023 года было сделано 3,3 тыс. фото. Это приложение начало работать в августе 2022 года. Всего за время с начала его работы по июль 2023 года включительно с его помощью было сделано 29,8 тыс. снимков аварий.\r\n', , '20th, Sep');

